    def isValid(self, s):
        """
        :type s: str
        :rtype: bool
        """

        stack = []
        for i in s:
            if i in ['(','{','[']:
                stack.append(i)
            else:
                if len(stack) == 0:
                    return False
                else:
                    if i == ')' and stack[-1] == '(':
                        stack.pop()
                    elif i == '}' and stack[-1] == '{':
                        stack.pop()
                    elif i == ']' and stack[-1] == '[':
                        stack.pop()
                    else:
                        return False
